{
  objectA = all(`test.isCompatibleValue:A`).firstElement();
  objectB = all(`test.isCompatibleValue:B`).firstElement();
  objectB2 = all(`test.isCompatibleValue:B2`).firstElement();
  objectD = all(`test.isCompatibleValue:D`).firstElement();


  test = [
    // Non-mandatory, non-multiple class reference
    isCompatibleValue(null, `test.isCompatibleValue:A#nonMandatoryNonMultipleClass`),  // true
    isCompatibleValue($objectB, `test.isCompatibleValue:A#nonMandatoryNonMultipleClass`),  // true
	isCompatibleValue($objectB2, `test.isCompatibleValue:A#nonMandatoryNonMultipleClass`),  // true
	isCompatibleValue($objectD, `test.isCompatibleValue:A#nonMandatoryNonMultipleClass`),  // false
    isCompatibleValue([], `test.isCompatibleValue:A#nonMandatoryNonMultipleClass`),  // true
    isCompatibleValue([$objectB], `test.isCompatibleValue:A#nonMandatoryNonMultipleClass`),  // true
    isCompatibleValue([$objectB, $objectB], `test.isCompatibleValue:A#nonMandatoryNonMultipleClass`),  // false

    // Non-mandatory, multiple class reference
    isCompatibleValue(null, `test.isCompatibleValue:A#nonMandatoryMultipleClass`),  // true
    isCompatibleValue($objectB, `test.isCompatibleValue:A#nonMandatoryMultipleClass`),  // true
    isCompatibleValue([], `test.isCompatibleValue:A#nonMandatoryMultipleClass`),  // true
    isCompatibleValue([$objectB], `test.isCompatibleValue:A#nonMandatoryMultipleClass`),  // true
    isCompatibleValue([$objectB, $objectB2], `test.isCompatibleValue:A#nonMandatoryMultipleClass`),  // true
	isCompatibleValue([$objectB, $objectD], `test.isCompatibleValue:A#nonMandatoryMultipleClass`),  // false

    // Mandatory, non-multiple class reference
    isCompatibleValue(null, `test.isCompatibleValue:A#mandatoryNonMultipleClass`),  // false
    isCompatibleValue($objectB, `test.isCompatibleValue:A#mandatoryNonMultipleClass`),  // true
    isCompatibleValue([], `test.isCompatibleValue:A#mandatoryNonMultipleClass`),  // false
    isCompatibleValue([$objectB2], `test.isCompatibleValue:A#mandatoryNonMultipleClass`),  // true
	isCompatibleValue([$objectD], `test.isCompatibleValue:A#mandatoryNonMultipleClass`),  // false
    isCompatibleValue([$objectB, $objectB2], `test.isCompatibleValue:A#mandatoryNonMultipleClass`),  // false
	isCompatibleValue([$objectB, $objectD], `test.isCompatibleValue:A#mandatoryNonMultipleClass`),  // false

    // Mandatory, multiple class reference
    isCompatibleValue(null, `test.isCompatibleValue:A#mandatoryMultipleClass`),  // false
    isCompatibleValue($objectB, `test.isCompatibleValue:A#mandatoryMultipleClass`),  // true
    isCompatibleValue([], `test.isCompatibleValue:A#mandatoryMultipleClass`),  // false
    isCompatibleValue([$objectB2], `test.isCompatibleValue:A#mandatoryMultipleClass`),  // true
    isCompatibleValue([$objectB, $objectB2, null], `test.isCompatibleValue:A#mandatoryMultipleClass`),  // true
