  objectA = all(`test.isCompatibleValue:A`).firstElement();
  objectB = all(`test.isCompatibleValue:B`).firstElement();

  test = [
    // Testing an empty collection against direct types (not through a part)
    isCompatibleValue([], `test.isCompatibleValue:A`),  // true
    isCompatibleValue([], `tl.core:String`),  // true

    // Testing nested collections
    isCompatibleValue([["test"]], `test.isCompatibleValue:A#nonMandatoryMultiplePrimitive`),  

    // Testing mixed types in collections
